import React from "react";
// import { Link } from "react-router-dom";
import "../../scss/components/Footer.scss";

function Footer() {
  return (
    <section className="Footer bg-info">
      <section className="Footer-Header d-flex ">
        <div className="Footer-Header-offers">
          <h2>hi footerrrrr</h2>
          <p>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
            eiusmod tempor incididunt ut labore et dolore
          </p>
        </div>

        <div className="Footer-Header-email">
          <h2>what styles are you interested?</h2>
          <div className="Footer-Header-email-details">
            <ul>
              <li>Women</li>
              <li>men</li>
              <li>kids</li>
            </ul>
          </div>
        </div>
      </section>
      <section className="Footer-Main"></section>
    </section>
  );
}
export default Footer;
